import { memo } from 'react';
import type { FC } from 'react';

import resets from '../_resets.module.css';
import { CircleIcon } from './CircleIcon';
import { JapanIcon } from './JapanIcon';
import { LasVegasIcon } from './LasVegasIcon';
import { LogoIcon } from './LogoIcon';
import { MaldivesMapIcon } from './MaldivesMapIcon';
import { AirplaneIcon } from './AirplaneIcon';
import { AirplaneIcon2 } from './AirplaneIcon2';
import { PhoneIcon } from './PhoneIcon';
import { EmailIcon } from './EmailIcon';
import { LoupeIcon } from './LoupeIcon';
import { StarIcon } from './StarIcon';
import { ArrowIcon } from './ArrowIcon';
import { CarIcon } from './CarIcon';
import { HeloIcon } from './HeloIcon';
import classes from './unnamed.module.css';
import { Player, Controls } from '@lottiefiles/react-lottie-player';
import $ from 'jquery';
import Carousel from 'react-multi-carousel';
import "react-multi-carousel/lib/styles.css";
import cpic from "./cpic.png"
import anim from "./1.json"
import email from "./email.json"

interface Props {
  className?: string;
}

var lottiePlayer = document.getElementsByTagName("lottie");

$(lottiePlayer).on('mouseenter', function(event) {
    console.log(this);
    "this.setDirection(1)"
    "this.play()"

}).on('mouseleave', function(event) {
    "this.setDirection(-1)"
    "this.play()"
});

const responsive = {
  superLargeDesktop: {
    // the naming can be any, depends on you.
    breakpoint: { max: 4000, min: 3000 },
    items: 5
  },
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 3
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 2
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1
  }
};

const sliderImageUrl = [
  //First image url
  {
    url: "https://i2.wp.com/www.geeksaresexy.net/wp-content/uploads/2020/04/movie1.jpg?resize=600%2C892&ssl=1",
  },
  {
    url: "https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/best-kids-movies-2020-call-of-the-wild-1579042974.jpg?crop=0.9760858955588091xw:1xh;center,top&resize=480:*",
  },
  //Second image url
  {
    url: "https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/best-movies-for-kids-2020-sonic-the-hedgehog-1571173983.jpg?crop=0.9871668311944719xw:1xh;center,top&resize=480:*",
  },
  //Third image url
  {
    url: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQS82ET2bq9oTNwPOL8gqyoLoLfeqJJJWJmKQ&usqp=CAU",
  },

  //Fourth image url

  {
    url: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTdvuww0JDC7nFRxiFL6yFiAxRJgM-1tvJTxA&usqp=CAU",
  },
];



export const _unnamed: FC<Props> = memo(function unnamed(props = {}) {
  return (
    <div className={`${resets.storybrainResets} ${classes.root}`}>
      <div className={classes.rectangle15}></div>
      <div className={classes._7Background}></div>
      <div className={classes.rectangle96}></div>
      <div className={classes.name}>Name</div>
      <div className={classes.rectangle97}></div>
      <div className={classes.surname}>Surname</div>
      <div className={classes.rectangle98}></div>
      <div className={classes.phoneNumber}>Phone number</div>
      <div className={classes.rectangle99}></div>
      <div className={classes.eMailAdress}>E-mail adress</div>
      <div className={classes.rectangle982}></div>
      <div className={classes.leaveAComment}>Leave a Comment</div>
      <div className={classes.rectangle94}></div>
      <div className={classes.letSTravel}>Let’s travel</div>
      <div className={classes.rectangle95}></div>
      <div className={classes._04Airplane}>
        <AirplaneIcon2 className={classes.icon15} />
      </div>
      <div className={classes.dearLadiesGentlemensWeWillTurn}>
        <p className={classes.labelWrapper9}>
          <span className={classes.label21}>Dear Ladies &amp; </span>
          <span className={classes.label22}>Gentlemen we will turn your journey into a true work of art</span>
        </p>
      </div>
      <div className={classes.dearLadiesGentlemensWeWillTurn2}>
        <p className={classes.labelWrapper10}>
          <span className={classes.label23}>Dear Ladies &amp; </span>
          <span className={classes.label24}>Gentlemen we will turn your journey into a true work of art</span>
        </p>
      </div>
      <div className={classes._8Background}></div>
      <div className={classes.logo}>
        <LogoIcon className={classes.icon5} />
      </div>
      <div className={classes.createYourDreamTour}>Create your dream tour</div>
      <div className={classes.rectangle152}></div>
      <div className={classes.airplane}>
        <AirplaneIcon className={classes.icon6} />
      </div>
      <div className={classes.rectangle153}></div>
      <div className={classes.unnamed}>+</div>
      <div className={classes.destinations}>Destinations</div>
      <div className={classes.rectangle154}></div>
      <div className={classes.unnamed2}>+</div>
      <div className={classes.rentals}>Rentals</div>
      <div className={classes.rectangle155}></div>
      <div className={classes.unnamed3}>+</div>
      <div className={classes.typeOfTrips}>
        <p className={classes.labelWrapper11}>
          <span className={classes.label25}>type </span>
          <span className={classes.label26}>of trips</span>
        </p>
      </div>
      <div className={classes.meetGreetServices}>Meet + Greet Services</div>
      <div className={classes.rectangle156}></div>
      <div className={classes.phoneCall}>
        <PhoneIcon className={classes.icon7} />
      </div>
      <div className={classes.rectangle157}>
      </div>
      <div className={classes.email}>
      </div>
      <div className={classes.rectangle158}>
      <Player
  hover
  src={anim}
></Player>
      </div>
      <div className={classes.eng}></div>
    </div>
  );
});
